import React from "react";

export default function SearchBarOptions() {
  return (
    <div className="options">
      <div className="options-main-category">
        <h2>Categories</h2>
        <div className="options-main-category-categories">
          <div className="category"> Food </div>
          <div className="category"> Clothing Store </div>
          <div className="category"> Gym </div>
          <div className="category"> Tourist Attraction </div>
          <div className="category"> Hair Dresser </div>
          <div className="category"> Supermarket </div>
        </div>
      </div>
    </div>
  );
}
